problem:
Using the U.S. Bureau of Labor Statistics Occupational Employment and Wage Statistics (OEWS) May 2020 national data (https://www.bls.gov/oes/), which occupation title, give it exactly as it appears in the OEWS table, satisfies all of the following conditions:
Its Standard Occupational Classification (SOC) code begins with “29” (Healthcare Practitioners and Technical Occupations);
It has a national mean annual wage greater than $200,000;
It has a national employment estimate below 5,000;
and, among the occupations that meet these criteria, it has the highest mean hourly wage.
Provide only the occupation title.
